import React from 'react';
import { useSelector } from 'react-redux';
import Sider from './pages/Sider';
import Content from './pages/Content';

function App() {

    const {users} = useSelector(state => state.userReducer)
    console.log(users);

    return (
        <div>
            <Sider/>
            <Content/>
        </div>
    );
}

export default App;
